import useDarkMode from 'use-dark-mode';
const TopNavbar = () => {
  const darkMode = useDarkMode(false);
  return (
    <div>
      <a href="#home">Home</a>
      <a href="#news">News</a>
      <a href="#contact">Contact</a>
      <style jsx>
        {`
        overflow: hidden;
  background-color: #333;
        .a{
          float: left;
  color: #f2f2f2;
  text-align: center;
  padding: 14px 16px;
  text-decoration: none;
  font-size: 17px;
        }
        `}
      </style>
    </div>
  );
};

export default TopNavbar;
